        protection and promoting fair competition in the food industry. The directive
        was adopted in 1989 and applied to all food products intended for human consumption
        within the EU member states.

        Key provisions of the Directive:

        1. Health and safety requirements: The directive established harmonized health
        and safety standards for food products, including maximum levels for contaminants,
        residues, and additives.

        2. Labelling and packaging: The directive specified requirements for labeling
        and packaging, including information on the product''s ingredients, allergens,
        and nutritional value.

        3. Food categories: The directive divided food products into several categories
        based on their characteristics and potential risks, such as baby food, cocoa
        products, and milk. Each category had specific requirements for safety and
        labeling.

        4. Risk assessment: The directive required member states to conduct regular
        risk assessments to identify potential hazards in the food chain and take
        appropriate measures to minimize them.

